back\":\"Excelente!\"}],\"showSolutions\":\"Mostrar soluções\",\"tryAgain\":\"Repetir\",\"checkAnswer\":\"Verificar\",\"submitAnswer\":\"Submit\",\"notFilledOut\":\"Por favor preenche todos os espaços em branco\",\"answerIsCorrect\":\"&#039;:ans&#039; está correta\",\"answerIsWrong\":\"&#039;:ans&#039; está incorreta\",\"answeredCorrectly\":\"Respondido corretamente\",\"answeredIncorrectly\":\"Respondido corretamente\",\"solutionLabel\":\"Resposta correta:\",\"inputLabel\":\"Resposta aberta @num de um total de @total\",\"inputHasTipLabel\":\"Dica disponível\",\"tipLabel\":\"Dica\",\"behaviour\":{\"enableRetry\":false,\"enableSolutionsButton\":false,\"enableCheckButton\":true,\"autoCheck\":false,\"caseSensitive\":false,\"showSolutionsRequiresInput\":true,\"separateLines\":false,\"confirmCheckDialog\":false,\"confirmRetryDialog\":false,\"acceptSpellingErrors\":false},\"scoreBarLabel\":\"Conseguiu :num pontos de um total de :total\",\"a11yCheck\":\"Verifique as respostas. Estas serão marcadas como corretas, incorretas, ou não respondidas.\",\"a11yShowSolution\":\"Mostrar a solução. A tarefa será marcada com a sua solução correta.\",\"a11yRetry\":\"Tente de novo. Apagar todas as respostas e iniciar de novo.\",\"a11yCheckingModeHeader\":\"Modo de verificação\",\"confirmCheck\":{\"header\":\"Terminar?\",\"body\":\"Tem a certeza que deseja terminar?\",\"cancelLabel\":\"Cancelar\",\"confirmLabel\":\"Terminar\"},\"confirmRetry\":{\"header\":\"Repetir ?\",\"body\":\"Tem a certeza que deseja repetir?\",\"cancelLabel\":\"Cancelar\",\"confirmLabel\":\"Confirmar\"},\"questions\":[\"<p>We wish you a merry Christmas<br>\\nWe wish you a merry *Christmas*<br>\\nWe wish you a *merry* Christmas<br>\\nAnd a happy New Year</p>\\n\\n<p>Good tidings we bring for you and your kin<br>\\nWe wish you a *merry* Christmas and a *happy* New Year</p>\\n\\n<p>Oh, bring us some figgy pudding<br>\\nOh, bring us some figgy *pudding*<br>\\nOh, bring us some *figgy* pudding<br>\\nAnd bring it right here</p>\\n\\n<p>Good tidings we *bring* for you and your kin<br>\\nWe wish you a *merry* Christmas and a happy *New* Year</p>\\n\\n<p>We won't go until we've got some<br>\\nWe won't go until we've *got* some<br>\\nWe won't go until we've got *some*<br>\\nSo bring some out here</p>\\n\\n<p>Good tidings we bring for you and your kin<br>\\nWe wish you a merry Christmas and a happy* New* Year</p>\\n\\n<p>We all like our figgy pudding<br>\\nWe *all* like our figgy *pudding*<br>\\nWe all *like* our figgy pudding<br>\\nWith all its good cheer</p>\\n\\n<p>Good tidings we bring for you and your kin<br>\\nWe wish you a merry Christmas and a happy New Year</p>\\n\\n<p>We wish you a merry Christmas<br>\\n*We* wish you a merry Christmas<br>\\nWe *wish* you a merry Christmas<br>\\n*And* a happy New Year!</p>\\n\"]}","library":"H5P.Blanks 1.14","contentUrl":".","metadata":{"license":"U","title":"We wish you a merry Christmas","defaultLanguage":"pt"},"scripts":["/h5p/libraries/H5P.Audio-1.5/scripts/audio.js?version=1.5.9","/h5p/libraries/H5P.Transition-1.0/transition.js?version=1.0.4","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-help-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-message-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progress-circle.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-simple-rounded-button.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-speech-bubble.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-throbber.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-tip.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-slider.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-score-bar.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progressbar.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-ui.js?version=1.3.19","/h5p/libraries/H5P.Question-1.5/scripts/question.js?version=1.5.15","/h5p/libraries/H5P.Question-1.5/scripts/e
